import React from 'react';


function Dashboard() {
  return (
    <>
    <div className='container-fluid'>
            <div class="sidebar">
                <a class="active" href="#home">Home</a>
                <a href="#news">News</a>
                <a href="#contact">Contact</a>
                <a href="#about">About</a>
            </div>
    </div>
    </>
  )
}

export default Dashboard
